import React from "react";
import "./Title.css"
import TypeIt from "typeit";



const Title = () => {

  new TypeIt('#title',{
    strings: "Test",
    speed: 95,
    loop: true

  }).go();


  return (
    <div id="title">
    </div>
  )

}

export default Title;
